import './App.css';
import Mainpage from "./components/mainpage"
import { BrowserRouter, Route } from "react-router-dom"
import Header from './components/header';
import Contact from './components/contact';

function App() {
  return (
    <div className="App">
      <Mainpage />
      <BrowserRouter>
        <Header />
        <Route path="/contact" render={()=> <Contact />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
